static float TWO_PI = 2 * M_PI;
static int mult = 2000 / (2.0 * M_PI);

// fake-ass soft-clipping
float boosted_sin_lookup(float phase)
{
    while (phase >= TWO_PI)
    {
        phase -= TWO_PI;
    }
    while (phase < 0)
    {
        phase += TWO_PI;
    }
    
    float three_phase = phase * 3;
    while (three_phase >= TWO_PI)
    {
        three_phase -= TWO_PI;
    }

    return sin_table[(int)(phase * mult)] + 0.2 * sin_table[(int)(three_phase * mult)];
}

float sin_lookup(float phase)
{
    while (phase >= TWO_PI)
    {
        phase -= TWO_PI;
    }
    while (phase < 0)
    {
        phase += TWO_PI;
    }
    
    return sin_table[(int)(phase * mult)];
}
